create table calendar_dates as 
select min_trx_date + rownum - 1 as issue_date
    from (select max(trx_date) as max_trx_date
               , min(trx_date) as min_trx_date 
            from customer_transactions)
 connect by rownum <= max_trx_date - min_trx_date;
